import React, { Component } from 'react';
import Head from 'next/head'
import Navbar from './Navbar'
import '../css/Layout.css';

const Layout = (props) => (
    <div className="Layout">
        <Head>
            <title>React Ranked Voting</title>
        </Head>
        <Navbar/>
        {props.children}
    </div>
);

export default Layout;
